import React from 'react';
import { Switch, Route } from 'react-router-dom';
import './App.css';
import Home from "./Home";
import SignUp from "./SignUp";

function App() {
  return (
    <>
    <Switch>
      <Route path="/" exact component= {Home} />
      <Route path="/SignUp" exact component = {SignUp} />
    </Switch>
    </>
  );
}

export default App;
